import { Link } from "react-router-dom";
import "./NavBar.css";
import { useSelector } from "react-redux";
// importo los archivos para poder hacer uso de Bootstrap
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle.min.js";

const NavBar = () => {
  const authenticated = useSelector((state) => state.isAuthenticated);
  const adminUser = useSelector((state) => state.profileUser);

  return (
    <>
      <div id="containerNavBar" className="container-fluid">
        {authenticated === true && adminUser.admin === true && (
          <>
            <div class="card text-center">
              <div class="card-header">
                <ul class="nav nav-tabs card-header-tabs">
                  <li class="nav-item">
                    <a class="nav-link active" aria-current="true" href="#">
                      <Link className="btn btn-three button" to="/Home">
                        Home
                      </Link>
                    </a>
                  </li>
                  <li class="nav-item">
                    <a class="nav-link" href="#">
                      Link
                    </a>
                  </li>
                  <li class="nav-item">
                    <a class="nav-link disabled" aria-disabled="true">
                      Disabled
                    </a>
                  </li>
                </ul>
              </div>
              <div class="card-body">
                <h5 class="card-title">Special title treatment</h5>
                <p class="card-text">
                  With supporting text below as a natural lead-in to additional
                  content.
                </p>
                <a href="#" class="btn btn-primary">
                  Go somewhere
                </a>
              </div>
            </div>
          </>
        )}
      </div>
    </>
  );
};

export default NavBar;
